    true,nt"url": null,nt"notes": "The annual Small Business Procurement Scorecard
    is an assessment tool to (1) measure how well federal agencies reach their small
    business and socio-economic prime contracting and subcontracting goals, (2) provide
    accurate and transparent contracting data and (3) report agency-specific progress.
    The prime and subcontracting component goals include goals for small businesses,
    small businesses owned by women (WOSB), small disadvantaged businesses (SDB), service-disabled
    veteran-owned small businesses (SDVOSB), and small businesses located in Historically
    Underutilized Business Zones (HUBZones).  Each federal agency has a different small
    business contracting goal, negotiated annually in consultation with SBA. SBA ensures
    that the sum total of all of the goals exceeds the 23 percent target established
    by law.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
